package com.shlapak.yaroslav.leetcode.problems1to100.problem3

/**
 * 3. Longest Substring Without Repeating Characters
 * Given a string s, find the length of the longest substring without duplicate characters.
 * https://leetcode.com/problems/longest-substring-without-repeating-characters/description/
 */

class Solution_2025_06_08 {
    fun lengthOfLongestSubstring1(s: String): Int {
        val set = mutableSetOf<Char>()
        var l = 0
        var max = 0
        for (i in 0 until s.length) {
            while (set.contains(s[i])) {
                set.remove(s[l])
                l++
            }
            set.add(s[i])
            max = maxOf(max, i - l + 1)
        }

        return max
    }

    fun lengthOfLongestSubstring2(s: String): Int {
        val map = mutableMapOf<Char, Int>()
        var max = 0
        var prev = 0
        for (i in 0 until s.length) {
            val ch = s[i]
            val idx = map[ch]
            if (idx != null) {
                prev = maxOf(prev, idx + 1)
            }
            map[ch] = i
            max = maxOf(max, i - prev + 1)
        }

        return max
    }

    fun lengthOfLongestSubstring3(s: String): Int {
        if (s.length < 2) return s.length
        val map = mutableMapOf<Char, Int>()
        var max = 0
        for (i in 0 until s.length) {
            val ch = s[i]
            val start = map.getOrPut(ch) { 0 }
            val set = mutableSetOf<Char>()
            for (j in i until s.length) {
                val idx = map[s[j]]
                if (set.contains(s[j])) {
                    break
                }
                set.add(s[j])
            }
            max = maxOf(set.size, max)
            map[ch] = i
        }

        return max
    }
}

class LongestSubstringWithoutRepeatingCharacters {
    fun lengthOfLongestSubstring(s: String): Int {
        val map = mutableMapOf<Char, Int>()
        var max = 0
        var startIndexOfLongestString = 0

        for (i in s.indices) {
            val ch = s[i]
            val indexOfPreviousOccurrence = map[ch]
            if (indexOfPreviousOccurrence != null) {
                startIndexOfLongestString = maxOf(startIndexOfLongestString, indexOfPreviousOccurrence + 1)
            }
            map[ch] = i
            max = maxOf(max, i - startIndexOfLongestString + 1)
        }

        return max
    }
}

class LongestSubstringWithoutRepeatingCharacters_O_N {
    fun lengthOfLongestSubstring(s: String): Int {
        var left = 0
        var max = 0
        val set = mutableSetOf<Char>()
        for (right in s.indices) {
            // remove from the left until duplicate removed
            while (set.contains(s[right])) {
                set.remove(s[left])
                left++
            }
            set.add(s[right])
            max = maxOf(max, set.size)
        }
        return max
    }
}

class Solution {
    var max = 0

    fun lengthOfLongestSubstring(s: String): Int {
        val set = mutableSetOf<Char>()
        val size = s.length
        var start = 0
        var end = 0
        while (start < size && end < size) {
            val character = s.get(end)
            if (set.contains(character)) {
                set.remove(s.get(start))
                start++
            } else {
                set.add(character)
                updateMax(set.size)
                end++
            }
        }

        return max
    }

    private fun updateMax(newMax: Int) {
        if (newMax > max) {
            max = newMax
        }
    }
}

